import data from './public/response.json'

function Video() {
  return (
    <>
      <div class='videoContent'>
        <select>
          {data.country.map((country) => {
            return <option key={country.id} value={country.id}>{country.name}</option>
          })}
        </select>
      </div>
    </>
  );
}

export default Video;


